      <h1>న్యూఢిల్లి : పార్లమెంటు ఉభయ సభలు ప్రారంభం</h1>

      <p>పార్లమెంటు ఉభయ సభలు ప్రారంభమయ్యాయి. లోక్‌సభలో స్పీకర్‌ ఓం బిర్లా సభాధ్యక్ష స్థానంలో ఉన్నారు. రాజ్యసభలో ఛైర్మన్‌ వెంకయ్యనాయుడు సభాధ్యక్ష స్థానంలో ఉన్నారు.</p>
